import "./style.css"

function NewMessage(){
    return(
        <div>
            <h2>Nouveau message</h2>
            <textarea rows="12" cols="80"></textarea>
            <div className="message-hud">
                <input type="submit" value="Envoyer"></input>
            </div>
        </div>
    )
}

export default NewMessage;
